Tonbo employs a Log-Structured Merge Tree (LSM) as its underlying data structure, meaning that some data may reside in memory. To persist this in-memory data, use the flush method. When Write-Ahead Logging (WAL) is enabled, data is automatically written to disk. However, since Tonbo buffers WAL data by default, you should call the flush_wal method to ensure all data is recovered. If you prefer not to use WAL buffering, you can disable it by setting wal_buffer_size to 0: let options = DbOption::new( Path::from_filesystem_path("./db_path/users").unwrap(), &UserSchema,
).wal_buffer_size(0); If you don't want to use WAL, you can disable it by setting the DbOption::disable_wal. let options = DbOption::new( Path::from_filesystem_path("./db_path/users").unwrap(), &UserSchema,
).disable_wal(true); Note : If you disable WAL, there is nothing to do with flush_wal. You need to call flush method to persist the memory data. Conversely, if WAL is enabled and wal_buffer_size is set to 0, WAL data is flushed to disk immediately, so calling flush_wal is unnecessary.

